'use strict';
let RolloverProfile = require('./RolloverProfile.js');
let variantCast = require('@gehtsoft/LuaxStdlib-node').variantCast;
//@@DocBrief("The builder of the RolloverProfile class")
class RolloverProfileBuilder extends RolloverProfile {
    setARPId(value) {
        this.arpId = value;
    }
    setOfferId(value) {
        this.offerID = value;
    }
    setRolloverBuyMarkup(value) {
        this.rolloverBuyMarkup = variantCast.castToReal(variantCast.fromString(value));
    }
    setRolloverSellMarkup(value) {
        this.rolloverSellMarkup = variantCast.castToReal(variantCast.fromString(value));
    }
    setChangeNo(value) {
        this.changeNo = variantCast.castToInt(variantCast.fromString(value));
    }
    build() {
        return this;
    }
}
module.exports = RolloverProfileBuilder
